    marginTop: '5%',
    marginLeft: '5%',
    marginRight: '5%',
    width: '80%',
    background: 'rgba(0, 0, 0, 0.2)',
    padding: '2% 5%',
    borderRadius: '6px',
    fontSize: '22px'
  }

const inputField = {

  }

function Contact() {

  return (
    <div>
        <div style={pageMargins}>
        <h1>Contact</h1>
            <div style={inputField}>
              <input type="text" placeholder="name" />
            </div>
            <div style={inputField}>
              <input type="number" placeholder="phone" />
            </div>
            <div style={inputField}>
              <input type="text" placeholder="email" />
            </div>
        </div>
    </div>
  );
}

export default Contact;
